import React from "react";
import Navbar from "../Base/Navbar";
import Header from "../Base/Header";
import { Link } from "react-router-dom";

const Premade = () => {

    return(
        <>
            <Header />

            <div className="mt-32 justify-center items-center flex">
                <img alt="beer guy" src={require('../img/beerguy.png')} className='w-72'/>
            </div>
            <div className="justify-center items-center mt-10">

                <Link to="/game1">
                    <div className="bg-blue-400 w-32 h-12 rounded-xl m-4 shadow-xl justify-center items-center flex">

                    </div>
                </Link>

                <Link to="/game2">
                    <div className="bg-blue-400 w-32 h-12 rounded-xl m-4 shadow-xl">

                    </div>
                </Link>

            </div>

            <Navbar />
        </>
    );
}

export default Premade;
